CREATE TABLE playlists (playlist_id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, type INT, title TEXT, rules BLOB, listViewColumnInfo BLOB, listViewSortColumn INT DEFAULT 2 NOT NULL, listViewAscending INT DEFAULT 1 NOT NULL, albumListViewColumnInfo BLOB, albumListViewSortColumn INT DEFAULT -1 NOT NULL, albumListViewAscending INT DEFAULT 1 NOT NULL, search TEXT DEFAULT '' NOT NULL, browser_1_attribute INT DEFAULT 0 NOT NULL, browser_2_attribute INT DEFAULT 0 NOT NULL, browser_3_attribute INT DEFAULT 2 NOT NULL, browser_1_selection BLOB, browser_2_selection BLOB, browser_3_selection BLOB, browserInfo BLOB, libraryViewMode INT DEFAULT 0 NOT NULL );
